          />
        </div>
        <div
          style={{
            display: "flex",
            flexBasis: "auto",
            flexDirection: "column",
            padding: "10px",
            width: "100%",
            height: "100%",
          }}
        >
          <Speechtotext
            speech={"/page.covidquestion"}
            keyword={keyword}
